import styled from "styled-components";

import React, { Component } from 'react';

export default styled.div`




  height: 450px;
  width: 100%;
  background: linear-gradient(to bottom, white, #6ae1e8, rgb(72, 218, 237), #10c2b6);
  color: #fff;
  margin: 0 50px;
  font-size: 1.5rem;
  border-radius:0 30px;
  margin-bottom:-50px;
`;
